  false,\n\t\"url\": null,\n\t\"notes\": \"Chlorophyll data were collected from a
  sewage outfall site in Kaneohe Bay, Hawaii, from 1982 to 2001. The purpose of the
  project was to study the responses of the ecosystem to the sewage diversion from
  the inner bay to an offshore, deep water location and to continue monitoring the
  location to denote changes associated with natural environmental and anthropogenic
  forcing on the primary productivity. Data were submitted by the University of Hawaii
  at Manoa and funding was provided by the Environmental Protective Agency (EPA).\",\n\t\"license_title\":
